	add("demy", "{\"term\":\"demy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A printing paper size, 17½ inches by 22½ inches\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A demyship\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1781\u0027\u0027, w:Samuel Samuel Johnson, \u0027Addison\u0027, \u0027w:Lives of the Most Eminent English Lives of the Poets\u0027, \u0027\u00271840\u0027\u0027, Arthur Murphy (editor), \u0027The Works of Samuel Johnson, LL. D.\u0027, Volume 2, [http://books.google.com.au/books?id\u003dIKs-AQAAMAAJ\u0026amp;pg\u003dPA132\u0026amp;dq\u003d%22He+was+elected+into+Magdalen+College+as+a+demy%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dLGSlU5XfCIeLkwXEcA\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22He%20was%20elected%20into%20Magdalen%20College%20as%20a%20demy%22\u0026amp;f\u003dfalse page 132\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"by whose recommendations he was elected into Magdalen College as a \u0027\u0027demy\u0027\u0027; a term by which that society denominates those elsewhere called \u0027scholars,\u0027 young men who partake of the founder\u0027s benefaction, and succeed in their order to vacant fellowships\", \"priority\":5}]}, \"synonyms\":{}}");

	add("demagnetization", "{\"term\":\"demagnetization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|de|magnetization|lang\u003den}} or from {{suffix|demagnetize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of removing the magnetic field from an object\", \"priority\":1}]}, \"synonyms\":{}}");

