	add("demagogue", "{\"term\":\"demagogue\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027δημαγωγός\u0027 (lang\u003dgrc) from \u0027δῆμος\u0027 (lang\u003dgrc) + \u0027ἀγωγός\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A leader of the people\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A political orator or leader who gains favor by pandering to or exciting the passions and prejudices of the audience rather than by using rational argument\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1938\u0027\u0027, Aristophanes, w:The \u0027The Knights\u0027, 424 BC, tr. O\u0027Neill , lines 191-193\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027demagogue\u0027\u0027 must be neither an educated nor an honest man; he has to be an ignoramus and a rogue\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027, w:S.I. S.I. Hayakawa, w:Language in Thought and \u0027Language in Thought and Action\u0027, p. ix\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"If the majority of our fellow-citizens are more susceptible to the slogans of fear and race hatred than to those of peaceful accommodation and mutual respect among human beings, our political liberties remain at the mercy of any eloquent and unscrupulous \u0027\u0027demagogue\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 December 4, w:Evan Evan Thomas, \u0027[http://www.newsweek.com/2010/12/04/the-deepest-dangers-facing-the-united-states.html Why It’s Time to Worry]\u0027, Newsweek\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"It is true that America has a paranoid streak in its politics, and \u0027\u0027demagogues\u0027\u0027 come along from time to time to feed on anger and resentment\", \"priority\":8}]}, \"synonyms\":{}}");

