	add("demand", "{\"term\":\"demand\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|demander}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The desire to purchase goods and services\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/5/will-ac-put-a-chill-on-the-global-energy-supply Will AC Put a Chill on the Global Energy passage\u003dNevertheless, it is clear that the global energy \u0027\u0027demand\u0027\u0027 for air-conditioning will grow substantially as nations become more affluent, with the consequences of climate change potentially accelerating the \u0027\u0027demand\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The amount of a good or service that consumers are willing to buy at a particular price\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A need\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A claim for something\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d8|passage\u003dThe humor of my proposition appealed more strongly to Miss Trevor than I had looked for, and from that time forward she became her old self again;. Our table in the dining-room became again the abode of scintillating wit and caustic repartee, Farrar bracing up to his old standard, and the \u0027\u0027demand\u0027\u0027 for seats in the vicinity rose to an animated competition\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A requirement\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An urgent request\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An order\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A measure of the maximum power load of a utility\u0027s customer over a short period of time; the power load integrated over a specified time interval\", \"priority\":10}]}, \"synonyms\":{}}");

	add("demanufacture", "{\"term\":\"demanufacture\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|de|manufacture|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A process of recycling that involves the dismantling and/or disassembly of an item to gain the maximum amount of recyclable materials\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Parties define the life cycle of electronic equipment broadly to include acquisition, design, manufacture, assembly, distribution, use, reuse, \u0027\u0027demanufacture\u0027\u0027, and recycling. (from the \u0026quot;Promoting Sustainable Environmental Stewardship of Federal Electronic Assets\u0026quot;] PDF signed 11-15-2004\", \"priority\":2}]}, \"synonyms\":{}}");

	add("demarcation", "{\"term\":\"demarcation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"Italian\", \"Portuguese\"], \"text\":\"First recorded c.1752, from Spanish {{m|es|linea de demarcacion}} and/or Portuguese {{m|pt|linha de demarcação}}, the {{m|en|demarcation line}} laid down by the Pope on May 4, 1493, dividing the New World between Spain and Portugal on a line 100 leagues west of the Cape Verde Islands. Both derive from {{m|es|demarcar}}, from {{m|es|de-}} + {{m|es|marcar||to mark}}, from Italian {{m|it|marcare}}, from the Germanic root of {{m|en|march}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of marking off a boundary or setting a limit, notably by belligerents signing a treaty or ceasefire\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A limit thus fixed, in full demarcation line\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any strictly defined separatio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"There is an alleged, in fact somewhat artificial \u0027\u0027demarcation\u0027\u0027 in the type of work done by members of different trade unions\", \"priority\":4}]}, \"synonyms\":{}}");

