	add("démarche", "{\"term\":\"démarche\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027démarche\u0027 from Middle french (ca. 1400-1600) from 12th century \u0027demarcher\u0027 (to march) \u0026lt;ref name\u003d\u0026quot;oetyld\u0026quot;\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt; from Old french (842-ca. 1400) \u0027demarchier\u0027 from \u0027de-\u0027 + \u0027marchier\u0027 \u0026lt;ref name\u003d\u0026quot;mw\u0026quot;\u0026gt;{{R:Merriam Webster Online}}\u0026lt;/ref\u0026gt;Attested 1658,\u0026lt;ref name\u003d\u0026quot;mw\u0026quot; /\u0026gt; in sense “walk, step”; meaning “a diplomatic move” attested from 1670s.\u0026lt;ref name\u003d\u0026quot;oetyld\u0026quot; /\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A diplomatic maneuver; one handled with finesse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A protest launched through diplomatic measures\", \"priority\":2}]}, \"synonyms\":{}}");

