	add("demassification", "{\"term\":\"demassification\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|de|mass|ification|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The breaking of a mass into separate units\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Robert Latham, \u0027Consuming Youth: Vampires, Cyborgs, and the Culture of Consumption\u0027 (page 149\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"According to Toffler, the \u0027\u0027demassification\u0027\u0027 of media—a parallel process to the demassification of markets—is ushering in the age of the \u0027modular\u0027 self\", \"priority\":3}]}, \"synonyms\":{}}");

