	add("demeanor", "{\"term\":\"demeanor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) {{m|enm|demenen|demenen, demeinen}}, from Anglo-norman {{m|fro|demener}}, from Old french (842-ca. 1400) {{m|fro|demener}}, from {{m|fro|de-}} + {{m|fro|mener||to conduct, lead}} + {{m|la|-or}}, from Latin {{m|la|*mināre||to drive}} and Latin {{m|la|minārī||to threaten}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The social, non-verbal behaviours (such as body language and facial expressions) that are characteristic of a person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The man\u0027s \u0027\u0027demeanor\u0027\u0027 made others suspicious of his intentions\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A confident \u0027\u0027demeanor\u0027\u0027 is crucial for persuading others\", \"priority\":3}]}, \"synonyms\":{}}");

	add("demeanour", "{\"term\":\"demeanour\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1521052W A Cuckoo in the passage\u003dBy some paradoxical evolution rancour and intolerance have been established in the vanguard of primitive Christianity. Mrs. Spoker, in common with many of the stricter disciples of righteousness, was as inclement in \u0027\u0027demeanour\u0027\u0027 as she was cadaverous in aspect\", \"priority\":1}]}, \"synonyms\":{}}");

