	add("dementia", "{\"term\":\"dementia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|dementia}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A progressive decline in cognitive function due to damage or disease in the brain beyond what might be expected from normal aging. Areas particularly affected include memory, attention, judgement, language and problem solving\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dSimilar studies of rats have employed four different intracranial resorbable, slow sustained release systems\u0026amp;mdash;\u0026amp;nbsp;[\u0026amp;hellip;]. Such a slow-release device containing angiogenic factors could be placed on the pia mater covering the cerebral cortex and tested in persons with senile \u0027\u0027dementia\u0027\u0027 in long term studies\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Madness or insanity\", \"priority\":3}]}, \"synonyms\":{}}");

	add("demerara", "{\"term\":\"demerara\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"File:Demerara sugar-1.JPG|right|thumb|Demerara sugarFrom one of the :w:Arawakan languages|Arawakan languages, where \u0027Immenary\u0027 or \u0027Dumaruni\u0027 mean \u0027“river of the letter wood”\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"right|thumb|Shortbread round\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A type of natural, unrefined or partially refined cane sugar, which is light brown in colour. It is particularly appreciated in pastries and biscuits like shortbread\", \"priority\":2}]}, \"synonyms\":{}}");

	add("demerit", "{\"term\":\"demerit\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027desmerite\u0027 (compare French \u0027démérite\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A quality of being inadequate; a fault; a disadvantag\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"They see no merit or \u0027\u0027demerit\u0027\u0027 in any man or any action\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Sir W. Templ\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Secure, unless forfeited by any \u0027\u0027demerit\u0027\u0027 or offense\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A mark given for bad conduct to a person attending an educational institution or serving in the army\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, s:Commencement Address at West Commencement Address at West Point, by G.W.Bush\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A few of you have followed in the path of the perfect West Point graduate, Robert E. Lee, who never received a single \u0027\u0027demerit\u0027\u0027 in four years. Some of you followed in the path of the imperfect graduate, Ulysses S. Grant, who had his fair share of \u0027\u0027demerits\u0027\u0027, and said the happiest day of his life was \u0026quot;the day I left West Point.\u0026quot; (Laughter\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"That which one merits or deserves, either of good or ill; desert\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Hollan\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"By many benefits and \u0027\u0027demerits\u0027\u0027 whereby they obliged their adherents, [they] acquired this reputation\", \"priority\":10}]}, \"synonyms\":{}}");

	add("demerol", "{\"term\":\"demerol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A marketed brand of the drug pethidine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1953\u0027\u0027, \u0027The Long Goodbye\u0027, Penguin 2010, p. 307\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"‘She must of grabbed some pills. There\u0027s half a dozen kinds up there – even \u0027\u0027demerol\u0027\u0027.’\", \"priority\":3}]}, \"synonyms\":{}}");

	add("demesne", "{\"term\":\"demesne\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027demeyne\u0027 \u0027\u0027 et al., Old french (842-ca. 1400) \u0027demeine\u0027 \u0027demaine\u0027 \u0027demeigne\u0027 \u0027domaine|lang\u003dfro\u0027 () (whence French \u0027lang\u003dfr|domaine\u0027 () , a noun use of an adjective, from Latin \u0027dominicus\u0027 (belonging to a lord or master) from \u0027lang\u003dla|dominus\u0027 () See \u0027\u0027 and compare \u0027\u0027 \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A lord’s chief manor place, with that part of the lands belonging thereto which has not been granted out in tenancy; a house, and the land adjoining, kept for the proprietor’s own use\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"section\u003dchapter passage\u003dI could spot no friendly native to tell me where I might find Bobbie. I proceeded, therefore, to roam hither and thither about the grounds and messuages in the hope of locating her, wishing that I had a couple of bloodhounds to aid me in my task, for the Travers \u0027\u0027demesne\u0027\u0027 is a spacious one and there was a considerable amount of sunshine above, though none, I need scarcely mention, in my heart\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"section\u003dCommentary, note to lines passage\u003dOne minute before his death, as we were crossing from his \u0027\u0027demesne\u0027\u0027 to mine and had begun working up between the junipers and ornamental shrubs, a Red Admirable (see note to line 270) came dizzily whirling around us like a colored flame\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A region or area; a domain\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1816,\u0027\u0027 w:John John Keats, \u0027s:On First Looking into Chapman\u0027s On First Looking into Chapman\u0027s Homer\u0027, lines 5\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Oft of one wide expanse had I been told\u0026lt;br\u0026gt;That deep-brow\u0027d Homer ruled as his \u0027\u0027demesne\", \"priority\":6}]}, \"synonyms\":{}}");

	add("demetallization", "{\"term\":\"demetallization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of removing traces of metal from a material (or from a surface), especially from a material that has been subjected to a metal-based catalysis\", \"priority\":1}]}, \"synonyms\":{}}");

	add("demeter", "{\"term\":\"demeter\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027δημήτηρ\u0027 from \u0027γῆ\u0027 + \u0027μήτηρ\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The goddess of the fertility of the Earth and harvests, protector of marriage and social order; daughter of Cronos and Rhea, mother to Persephone. Her Roman counterpart is Ceres\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Short for , a main belt asteroid\", \"priority\":2}]}, \"synonyms\":{}}");

