	add("demetrius", "{\"term\":\"demetrius\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) Δημήτριος \u0026quot;belonging to Δημήτηρ (Demeter, the earth goddess)\u0026quot;; from Δή (De), an early form of Γή (Ge) \u0026quot;earth\u0026quot; + μήτηρ (meter) \u0026quot;mother\u0026quot;.{{wikipedia}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"of mostly historical use in English\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Demetrius\u0027\u0027 hath good report of all men, and of the truth itself: yea, and we also bear record; and ye know that our record is true\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027 w:Don Don DeLillo, \u0027Falling Man\u0027, Scribner, ISBN 1416546022, page 105\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The easy names were the ones she forgot. But this one wasn\u0027t easy and it was like the swaggering name of some football player from Alabama and that\u0027s how she remembered it, \u0027\u0027Demetrius\u0027\u0027, badly burned in the other tower, the south tower\", \"priority\":4}]}, \"synonyms\":{}}");

	add("demibra", "{\"term\":\"demibra\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|demi|bra|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A revealing brassiere with demicups rather than full coverage of the breasts\", \"priority\":1}]}, \"synonyms\":{}}");

