	add("demidevil", "{\"term\":\"demidevil\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|demi|devil|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A half-devil\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Shakespeare\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Othello: Will you, I pray, demand that demi-devil / Why he hath thus ensnared my body and soul\", \"priority\":3}]}, \"synonyms\":{}}");

	add("demigod", "{\"term\":\"demigod\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Calque of the Latin semideus, \u0026quot;half-god\u0026quot;, which is probably a coining by the Roman poet Ovid in reference to less important gods, such as dryad|dryads.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A half-god or hero; the offspring of a deity and a mortal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A lesser deity\", \"priority\":2}]}, \"synonyms\":{}}");

	add("demihypercube", "{\"term\":\"demihypercube\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|demi|hypercube|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a class of \u0027n\u0027-polytopes constructed from alternation of an \u0027n\u0027-hypercube\", \"priority\":1}]}, \"synonyms\":{}}");

	add("demijohn", "{\"term\":\"demijohn\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027dame-jeanne\u0027 of uncertain origin.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large bottle with a short neck, sometimes with two small handles at the neck, sometimes encased in wickerwork\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, w:Peter B. Peter B. Kyne, \u0027The Understanding Heart\u0027, Chapter VII\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"“Reckon it\u0027s first-drink time,” the old prospector cried cheerily, and unearthed Monica\u0027s two-gallon \u0027\u0027demijohn\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, \u0027Monsieur\u0027, Faber \u0026amp; Faber 1992, p. 234\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Toby, placing his gold-rimmed spectacles on his nose, set our dinner to simmer and uncorked a \u0027\u0027demijohn\u0027\u0027 of the old Verfeuille red which glowed in our glasses with the embers of old recollections of half-forgotten journeys and excursions of our youth by the light of the moon\", \"priority\":5}]}, \"synonyms\":{}}");

	add("demilitarisation", "{\"term\":\"demilitarisation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The removal of a military force, usually at the end of hostilities or as part of a treaty\", \"priority\":1}]}, \"synonyms\":{}}");

