	add("demirep", "{\"term\":\"demirep\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|demi|reputation|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman of doubtful reputation or suspected character; an adventuress\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1749\u0027\u0027, \u0027Tom Jones\u0027, Folio Society 1973, page 569\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"he had no knowledge of that character which is vulgarly called a \u0027\u0027demirep\u0027\u0027; that is to say, a woman who intrigues with every man she likes, under the name and appearance of virtue [...] in short, whom everybody knows to be what nobody calls her\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1813\u0027\u0027, in a journal article about the prince.(Chambers, R.. \u0026quot;\u0027The Book of Days\u0027: A miscellany of popular antiquities. Londres: W \u0026amp; R Chambers, 1832.\u0026quot; [http://books.google.com.br/books?id\u003d3hJLeLHjh-YC\u0026amp;pg\u003dPA598\u0026amp;dq\u003dchambers+hunt+popular.antiquities\u0026amp;as_brr\u003d3\u0026amp;sig\u003dACfU3U17GpaLy3Cd-UB-RFQlGvuP-eFIsw Google Books\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"in short, this delightful, blissful, wise, pleasurable, honourable, virtuous, true, and immortal prince, was a violator of his word, a libertine, over head and ears in disgrace, a despiser of domestic ties, the companion of gamblers and \u0027\u0027demireps\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1822\u0027\u0027, \u0027s:Confessions of an English Confessions of an English Opium-Eater\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"the greater part of \u0027our\u0027 confessions (that is, spontaneous and extra-judicial confessions) proceed from \u0027\u0027demireps\u0027\u0027, adventurers, or swindlers\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1904\u0027\u0027, \u0027s:The Ballad of Reading The Ballad of Reading Gaol\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"With the mincing step of a \u0027\u0027demirep\u0027\u0027 / Some sidled up the stairs\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1932\u0027\u0027, \u0027Talleyrand\u0027, Folio Society 2010, p. 65\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"In this new world, ruled by charlatans and dominated by \u0027\u0027demireps\u0027\u0027, Talleyrand may have found much to shock his sense of decorum, but little to outrage his moral standards\", \"priority\":11}]}, \"synonyms\":{}}");

	add("demise", "{\"term\":\"demise\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Latin \u0027demissa\u0027 () feminine singular of perfect passive participle of {{m|la|dēmittō}}, apparently via Middle french (ca. 1400-1600) \u0027démise\u0027 the feminine singular past participle of \u0027démettre\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The conveyance or transfer of an estate, either in fee for life or for years, most commonly the latter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Transmission by formal act or conveyance to an heir or successor; transference; especially, the transfer or transmission of the crown or royal authority to a successor\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Death\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"end (less common, usually in a negative manner\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The lack of funding ultimately led to the \u0027\u0027demise\u0027\u0027 of the project\", \"priority\":5}]}, \"synonyms\":{}}");

	add("demisemiquaver", "{\"term\":\"demisemiquaver\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a thirty-second note, drawn as a crotchet with three tails\", \"priority\":1}]}, \"synonyms\":{}}");

	add("demisexuality", "{\"term\":\"demisexuality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|demisexual|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being sexually or romantically attracted only to people with whom one has a strong emotional bond\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Holly Combs, \u0026quot;[http://www.loyolamaroon.com/polopoly_fs/7.28345!/MaroonMerged.pdf Labeling sexuality is not simple]\u0026quot;, \u0027The Maroon\u0027 (Loyola University New Orleans), Volume 90, Number 10, 11 November 2011, page 6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Asexuality with the ability to experience romantic attraction should not be confused with \u0027\u0027demisexuality\u0027\u0027, which is somewhat similar\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, [http://issuu.com/spectrumcenter/docs/mbgltacc2011book Midwest Bisexual Lesbian Gay Transgender Ally College Conference 2011 program], page 30\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This workshop aims to be a comprehensive coverage of the basics about sexual orientation, gender identity, and LGBT topics with a special focus on asexuality and \u0027\u0027demisexuality\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Adrienne Smith, \u0026quot;[http://autismnow.org/wp-content/uploads/2013/02/Relationships-and-Sexuality-Tool.pdf Cultural Fascination]\u0026quot;, in \u0027Relationships \u0026amp; Sexuality\u0027 (eds. Elesia Askenazy \u0026amp; Melanie Yergeau), page 96\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Demisexuality\u0027\u0027 further complicates my orientation. Or, at the very least, \u0027\u0027demisexuality\u0027\u0027 imposes more difficulty in describing my particular brand of queerness\", \"priority\":7}]}, \"synonyms\":{}}");

	add("demisharp", "{\"term\":\"demisharp\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|demi|sharp|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In microtonal music, a note played a quarter tone higher than a natural\", \"priority\":1}]}, \"synonyms\":{}}");

	add("demission", "{\"term\":\"demission\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027démission\u0027 from Latin {{m|la|dēmissiō}}, from {{m|la|dēmittō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Resignation; abdication\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1820,\u0027\u0027 Sir Walter Scott, \u0027The Abbot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And that this \u0027\u0027demission\u0027\u0027 of our royal authority may have the more full and solemn effect, and none pretend ignorance, we give [our cousins authority] ... in our name and behalf, publicly, and in their presence, to renounce the Crown, guidance, and government of this our kingdom of Scotland\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, Vladimir Nabokov, \u0027Ada or Ardor\u0027, Penguin 2011, p. 226\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She had just slipped her \u0027\u0027demission\u0027\u0027, with a footnote on the young lady\u0027s conduct, under the door of Madame\", \"priority\":5}]}, \"synonyms\":{}}");

	add("demisting", "{\"term\":\"demisting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The removal of the layer of fine liquid particles from the surface of a window or mirror\", \"priority\":1}]}, \"synonyms\":{}}");

	add("demitint", "{\"term\":\"demitint\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|demi|tint|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That part of a painting, engraving, etc. which is neither in full darkness nor full light\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The shade itself; neither the darkest nor the lightest in a composition\", \"priority\":2}]}, \"synonyms\":{}}");

	add("demiurge", "{\"term\":\"demiurge\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027δημιουργός\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The subordinate being that fashions the perceptible world in the light of eternal ideas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A prideful, inferior being that creates the material world; frequently identified with the creator God of the Hebrew Bible\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Hans Jonas, \u0027The Gnostic Religion: The message of the alien God\u0027, page 19\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"For the rest, we meet in the \u0027\u0027Demiurge\u0027\u0027 of the Valentinians all the traits of the world-god with which we have by now become familiar and can therefore deal here very briefly\", \"priority\":4}]}, \"synonyms\":{}}");

	add("demon", "{\"term\":\"demon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027daemon\u0027 (lar, genius, guardian spirit) from Ancient Greek \u0027δαίμων\u0027 (dispenser, god, protective spirit)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An evil spirit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A fallen angel or Satanic divinity; a false god\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One’s inner spirit or genius, a daimon\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A genius, a lar, the protective spirit or godling of a place, household, or individual.\u0026lt;!--really?--\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A foible; a flaw in a person’s character\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027demon\u0027\u0027 of stupidity haunts me whenever I open my mouth\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Someone of remarkable or diabolical energy or ability\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"He’s a \u0027\u0027demon\u0027\u0027 at the card tables\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Anything with malevolent effects\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027demon\u0027\u0027 drink\", \"priority\":10}]}, \"synonyms\":{}}");

	add("demobilization", "{\"term\":\"demobilization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The disorganization or disarming of troops which have previously been mobilized or called into active service; the change from a war footing to a peace footing; the act of demobilizing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("democide", "{\"term\":\"democide\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Based on Ancient greek (to 1453) \u0027δῆμος\u0027 (people) {{suffix||cide|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"mass Mass) murder of people by a government which has power over them\", \"priority\":1}]}, \"synonyms\":{}}");

	add("democoder", "{\"term\":\"democoder\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|demo|coder|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A computer programmer who creates demos for the demoscene\", \"priority\":1}]}, \"synonyms\":{}}");

	add("democracy", "{\"term\":\"democracy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\"], \"text\":\"{{confix|demo|cracy|lang\u003den}}, from Middle french (ca. 1400-1600) \u0027democratie\u0027 (French \u0027démocratie\u0027 , from \u0027democratia\u0027 from Ancient greek (to 1453) \u0027δημοκρατία\u0027 from \u0027δῆμος\u0027 (common people\u0026quot;, \u0026quot;assembly of the people) + \u0027κράτος\u0027 (rule, strength)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Rule by the people, especially as a form of government; either directly or through elected representatives (representative democracy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1866\u0027\u0027, J. Arthur Partridge, \u0027On Democracy\u0027, Trübner \u0026amp; Co., page 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And the essential value and power of \u0027\u0027Democracy\u0027\u0027 consists in this,—that it combines, as far as possible, power and organization ; THE SPIRIT, MANHOOD, \u0027is at one with\u0027 THE BODY, ORGANIZATION. [....] \u0027\u0027Democracy\u0027\u0027 is Government by the People\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1901\u0027\u0027, \u0027The American Historical Review\u0027, American Historical Association, page 260\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The period, that is, which marks the transition from absolutism or aristocracy to \u0027\u0027democracy\u0027\u0027 will mark also the transition from absolutist or autocratic methods of nomination to democratic methods\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1921\u0027\u0027, James Bryce Bryce, \u0027Modern Democracies\u0027, The Macmillan Company, page 1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A century ago there was in the Old World only one tiny spot in which the working of \u0027\u0027democracy\u0027\u0027 could be studied. A few of the ancient rural cantons of Switzerland had recovered their freedom after the fall of Napoleon, and were governing themselves as they had done from the earlier Middle Ages[...]. Nowhere else in Europe did the people rule\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Nelson Mandela, \u0027Long Walk to Freedom\u0027, Abacus 2010, p. 24\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Everyone who wanted to speak did so. It was \u0027\u0027democracy\u0027\u0027 in its purest form\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A government under the direct or representative rule of the people of its jurisdiction\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Fareed Zakaria, \u0027The Future of Freedom: Illiberal Democracy at Home and Abroad\u0027, W. W. Norton \u0026amp; Company, page 13\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In 1900 not a single country had what we would today consider a \u0027\u0027democracy\u0027\u0027: a government created by elections in which every adult citizen could vote\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Belief in political freedom and equality; the \u0026quot;spirit of democracy\u0026quot\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, Charles Horton Cooley, “A Primary Culture for Democracy”, in \u0027Publications of the American Sociological Society 13\u0027, [http://books.google.com/books?id\u003dcvUZAAAAIAAJ\u0026amp;pg\u003dPA8\u0026amp;dq\u003ddemocracy p8\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"As states of the human spirit \u0027\u0027democracy\u0027\u0027, righteousness, and faith have much in common and may be cultivated by the same means\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, Tomáš Garrigue Masaryk, \u0027The Spirit of Russia: Studies in History, Literature and Philosophy\u0027, Macmillan, [http://books.google.com/books?id\u003daLAcAAAAMAAJ\u0026amp;pg\u003dRA4-PA446\u0026amp;dq\u003ddemocracy p446\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"It must further be admitted that he provided a successful interpretation of \u0027\u0027democracy\u0027\u0027 in its philosophic aspects when he conceived \u0027\u0027democracy\u0027\u0027 as a general outlook on the universe... In Bakunin\u0027s conception of \u0027\u0027democracy\u0027\u0027 as religious in character we trace the influence of French socialism\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Petre Roman, \u0027The Spirit of Democracy and the Fabric of NATO - The New European Democracies and NATO Enlargement\u0027, [http://www.fas.org/man/nato/natodocs/an246pc.htm p1\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The spirit of \u0027\u0027democracy\u0027\u0027 means, above all, liberty of choice for human beings... \u0027\u0027democracy\u0027\u0027, in both its individual and collective forms, is the main engine of the eternal human striving for justice and prosperity\", \"priority\":19}]}, \"synonyms\":{}}");

	add("democrat", "{\"term\":\"democrat\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027lang\u003dfr\u0027 from \u0027démocratie\u0027 (modelled on \u0027aristocrate\u0027 (aristocrat) .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A supporter of democracy; an advocate of democratic politics (originally as opposed to the aristocrats in Revolutionary France\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone who rules a representative democracy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Wesley Yang, \u0026quot;Death, Dictators, and Democracy\u0026quot;, \u0027NYU Alumni Magazine\u0027, ISSN 1938-4823, issue 16, Spring 2011, page 10\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Democrats\u0027\u0027 have to please a large segment of the voting public and will be punished if they fail to provide public goods. In the case of autocrats, however, they have to please a small minority of the governing power elite who will punish them if they fail to dedicate the public purse to their private enrichment\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A large light uncovered wagon with two or more seats\", \"priority\":5}]}, \"synonyms\":{}}");

	add("democratism", "{\"term\":\"democratism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The principles or spirit of a democracy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("democratization", "{\"term\":\"democratization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|democratize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The introduction of democracy, its functions or principles, to an area or country which did not have democracy previously\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The spread of democracy as a concept\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The making more democratic of a political system\", \"priority\":3}]}, \"synonyms\":{}}");

	add("democritus", "{\"term\":\"democritus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027δημόκριτος\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Greek philosopher (c.460-c.370 BC). The originator of the atomic theory together with his teacher Leucippus\", \"priority\":1}]}, \"synonyms\":{}}");

